import React, { useState, useEffect } from "react";

const App = () => {
  const [click, setClick] = useState(0);
  useEffect(() => {
    document.title = `you Clicked ${click}`;
  });
  const ButtonClickEvent = () => {
    setClick(click + 1);
  };

  return <button onClick={ButtonClickEvent}>Click Me {click}</button>;
};

export default App;
